function FormularioAddPersona() {

    useEffect(() => {
        console.log("Loading...");
        const fetchData = async (userId, title, body) => {
          try {
            const { data } = await Axios.post(
              "https://jsonplaceholder.typicode.com/posts",
              {
                title,
                body,
                userId
              }
            );
            console.log(data);
          } catch (error) {
            console.log(error);
          }
        };
      
        fetchData(
          1,
          "Bacon ipsum",
          "Bacon ipsum dolor amet drumstick short loin frankfurter beef boudin, tail ball tip venison picanha tongue"
        );
      }, []);
    
    return (
        <form action='http://localhost:8080/persona' method='post'>
            <label for="nombre">Nombre
                <input type="text" name="nombre" placeholder="Nombre" id="nombre" />
            </label>
            <label for="edad">Edad
                <input type="number" name="edad" placeholder="Edad" id="edad" />
            </label>
            <input type="submit" value="Guardar"/>
        </form>
    );
}
export default FormularioAddPersona;
